import React,{Component} from 'react';
import {Wrapper,Container} from './home.style'

class App extends Component {
  render(){
  return (
    <Container>
      <Wrapper>
          {this.props.children}
      </Wrapper>
    </Container>
    );
  }
}

export default App;
